css:
@-moz-document domain("www.leitstellenspiel.de"), domain("www.meldkamerspel.com"), domain("www.missionchief.com") {
body {
    background-color: #222;
    color: #ddd;
    font-family: -apple-system,BlinkMacSystemFont,"Segoe UI",Roboto,"Helvetica Neue",Arial,"Noto Sans",sans-serif,"Apple Color Emoji","Segoe UI Emoji","Segoe UI Symbol","Noto Color Emoji";
}

#lightbox_box {
    background-color: #222;
    border: 1px solid #555 !important;
}

.alert a {
    color: #2441ce;
}

input[type=checkbox] {
    -webkit-appearance: none;
    width: 15px;
    height: 15px;
    border: 1px solid #ccc;
    border-radius: 3px;
    background-color: #222;
    transition: background-color .1s ease-in-out, border-color .1s ease-in-out;
    outline: none;
}

input[type=checkbox]:checked {
    background-color: #999;
    border-color: #eee;
    outline: none;
}

input[type=checkbox]:focus {
    outline: none;
}

.jumbotron {
    background-color: #333;
}

.progress {
    display: -ms-flexbox;
    display: flex;
    height: 1.6rem;
    overflow: hidden;
    font-size: .75rem;
    background-color: #e9ecef;
    border-radius: .25rem;
}

.progress-bar {
    flex-direction: column;
    justify-content: center;
    color: #fff;
    text-align: center;
    white-space: nowrap;
    transition: width .6s ease;
}

.progress-striped-inner-active {
    animation: progress-bar-stripes 1s linear infinite;
    background-image: linear-gradient(45deg,rgba(255,255,255,.15) 25%,transparent 25%,transparent 50%,rgba(255,255,255,.15) 50%,rgba(255,255,255,.15) 75%,transparent 75%,transparent);
    background-size: 1.6rem 1.6rem;
}

.patient_progress .progress-striped-inner-active {
    background-size: 1.6rem 1.6rem;
}

.mission_header_info .progress, .mission_header_info .progress-striped-inner-active {
    height: 23px;
}

.mission_header_info .progress-bar,  .mission_header_info .progress-striped-inner-active {
    animation: progress-bar-stripes-2 1s linear infinite;
    background-size: 23px 23px;
}

.progress-bar-success, .progress-bar-warning, .progress-bar-danger {
    background-image: none;
}

@keyframes progress-bar-stripes {
    from {
        background-position: 1.6rem 0
    }

    to {
        background-position: 0 0
    }
}

@keyframes progress-bar-stripes-2 {
    from {
        background-position: 23px 0
    }

    to {
        background-position: 0 0
    }
}

/* Navbar */
.navbar-default {
    background-color: #2e2e2e;
    border-color: #666;
    box-shadow: 0 3px 6px rgba(0,0,0,0.16), 0 3px 6px rgba(0,0,0,0.23);
}

.navbar-default .navbar-nav>li>a {
    color: #ddd;
}

.navbar-default .navbar-nav>li>a:focus, .navbar-default .navbar-nav>li>a:hover {
    color: #fff;
}

#map_adress_search {
    height: auto;
    margin-top: auto;
}

#restore_map {
    background-image: none;
    background-color: #2e2e2e;
}

.form-controls {
    display: block;
    width: 100%;
    height: 34px;
    padding: 6px 12px;
    font-size: 14px;
    line-height: 1.42857143;
    color: #555;
    background-color: #fff;
    background-image: none;
    border: 1px solid #ccc;
    border-radius: 4px;
    -webkit-box-shadow: inset 0 1px 1px rgba(0,0,0,0.075);
    box-shadow: inset 0 1px 1px rgba(0,0,0,0.075);
    -webkit-transition: border-color ease-in-out .15s,-webkit-box-shadow ease-in-out .15s;
    -o-transition: border-color ease-in-out .15s,box-shadow ease-in-out .15s;
    transition: border-color ease-in-out .15s,box-shadow ease-in-out .15s;
}

.navbar-default .dropdown-menu a:hover, .navbar-default .navbar-nav>.open>a, .navbar-default .navbar-nav>.open>a:focus, .navbar-default .navbar-nav>.open>a:hover {
    background-color: #666;
    background-image: none;
    color: #fff !important;
}

.navbar-default .dropdown-menu {
    background-image: none;
    background-color: #444;
    text-shadow: none;
    color: #fff;
}

.navbar-default li:hover {
    background-color: #4e4e4e !important;
}

.alliance_apply_new {
    background-color: #ff000030;
}

/*Missions*/
#search_input_field_missions {
    border: 1px solid #555;
}

input {
    background-color: #444;
}

.panel {
    background-color: #222;
}

.panel-default {
    border-color: #444;
}

.progress {
    background-color: #1a1a1a;
}

th.tablesorter-headerUnSorted::before, th.tablesorter-headerDesc::before, th.tablesorter-headerAsc::before {
    content: "";
    position: absolute;
    top: 50%;
    right: 0;
    width: 21px;
    height: 50%;
    filter: invert(1);
    background-image: url("https://www.leitstellenspiel.de/images/bg.gif");
    background-repeat: no-repeat;
    background-size: 21px 9px;
}
th.tablesorter-headerUnSorted, th.tablesorter-headerDesc, th.tablesorter-headerAsc {
    background-image: none;
    position: relative;
}
th.tablesorter-headerDesc::before {
    background-image: url("https://www.leitstellenspiel.de/images/desc.gif");
    background-size: 21px 4px;
}
th.tablesorter-headerAsc::before {
    background-image: url("https://www.leitstellenspiel.de/images/asc.gif");
    background-size: 21px 4px;
}
.sorter-false::before {
    background-image: none !important;
}

img[title="Besatzung"] {
    filter: invert(1);
}

.mission_panel_yellow {
    border-left: 5px #ffc107 solid !important;
}

.mission_panel_green {
    border-left: 5px #15bf3c solid !important;
}

.pagination>.disabled>a, .pagination>.disabled>a:focus, .pagination>.disabled>a:hover, .pagination>.disabled>span, .pagination>.disabled>span:focus, .pagination>.disabled>span:hover {
    color: #ddd;
    background-color: #212121;
    border-color: #555;
}

.pagination>.active>a, .pagination>.active>a:focus, .pagination>.active>a:hover, .pagination>.active>span, .pagination>.active>span:focus, .pagination>.active>span:hover {
    color: #ddd;
    background-color: #666;
    border-color: #777;
}

.pagination>li>a, .pagination>li>span {
    color: #ddd;
    background-color: #333;
    border: 1px solid #555;
}

.pagination>li>a:focus, .pagination>li>a:hover, .pagination>li>span:focus, .pagination>li>span:hover {
    color: #ddd;
    background-color: #5e5e5e;
    border-color: #666;
}

/* Windows Bottom */
.panel-heading {
    padding-left: .5rem;
}

.panel-default>.panel-heading {
    background-color: #333;
    color: #ddd;
    border-color: #555;
}

.panel-success>.panel-heading {
    background-color: #28a745;
    background-image: none;
}

a {
    color: #81d4fa;
    text-decoration: none;
}

.building_list_caption {
    background-color: #3f3f3f;
}

.btn-default {
    color: #ddd;
    background-image: linear-gradient(to bottom, #3f3f3f 0, #343434 100%);
    border-color: #444;
}

.btn-default:focus, .btn-default:hover {
    background-color: #555;
    background-position: 0 -45px;
    border-color: #444;
    color: #eee;
}

.input-group-addon {
    color: #ddd;
    background-color: #333;
    border: 1px solid #666;
}

.string.required {
    margin-bottom: 0;
}

abbr[title=required] {
    display: none;
}

.form-control, .form-controls {
    color: #ddd;
    background-color: #444;
    border: 1px solid #666;
}

#alliance_chat_header_info {
    box-shadow: 0 3px 6px rgba(0,0,0,0.16), 0 3px 6px rgba(0,0,0,0.23);
}

.alert {
    position: relative;
    padding: .75rem 1.25rem;
    margin-bottom: 1rem;
    border: 1px solid transparent;
    border-radius: .25rem;
}

.alert-info {
    color: #004085;
    background-color: #cce5ff;
    border-color: #b8daff;
}

.alert.alert-info a {
    color: white;
}

.alert-success {
    color: #155724;
    background-color: #d4edda;
    border-color: #c3e6cb;
}

.alert-warning {
    color: #856404;
    background-color: #fff3cd;
    border-color: #ffeeba;
}

.alert-danger {
    background-image: none;
    color: #721c24;
    background-color: #f8d7da;
    border-color: #f5c6cb;
}

hr {
    margin-top: 20px;
    margin-bottom: 20px;
    border: 0;
    border-top: 1px solid #444;
}

/* Mission window */
.breadcrumb {
    margin-top: .5em;
    background-color: #333;
}

div[id^='mission_water_progress'] {
    height: 26px;
}

div[id^='mission_water_bar_missing'] {
    color: #333;
}

.progress-bar-mission-window-water {
    padding-top: 2px;
}

/* Vehicle Tables */
.table-striped>tbody>tr:nth-of-type(odd) {
    background-color: #3f3f3f;
}

.table-striped>tbody>tr:nth-of-type(even) {
    background-color: #333;
}

.table-striped>tbody>tr:hover {
    background-color: #555;
}

.table>tbody>tr>td, .table>tbody>tr>th, .table>tfoot>tr>td, .table>tfoot>tr>th, .table>thead>tr>td, .table>thead>tr>th {
    border-top: 1px solid #5a5a5a;
}

.table>thead>tr>th {
    border-bottom: 2px solid #5a5a5a;
}

.mission_patient {
    background-color: #333;
    color: #ddd;
}

th.tablesorter-headerDesc, th.tablesorter-headerAsc {
    background-color: #222;
}

tr.success {
    color: #333;
}

/* Vehicle Buy Window */
.well {
    background-image: none;
    background-color: #333;
    border-color: #555;
    box-shadow: inset 0 1px 3px rgba(0,0,0,0.05), 0 1px 0 rgba(255,255,255,0.1);
}

/* Category Nav */
.nav-tabs>li.active>a, .nav-tabs>li.active>a:focus, .nav-tabs>li.active>a:hover {
    background-image: none;
    background-color: #c9302c;
    color: #fff;
    border-color: #555;
}

.nav-tabs>li>a {
    background-color: #222;
    border: 1px solid #555;
    color: #ddd;
}

.nav-tabs>li>a:hover {
    border-color: #555;
}

.nav>li>a:focus, .nav>li>a:hover {
    background-color: #444;
    color: #ffff;
}

/* Scroll Bars */
::-webkit-scrollbar {
    width: 14px;
    background: #111;
}

::-webkit-scrollbar-thumb {
    border-radius: 1px;
    background: #222;
    border: .2em solid #444;
}

::-webkit-scrollbar-corner {
    background: #000;
}

/* Bootstrap 4 */
/* Buttons */
.btn {
    display: inline-block;
    font-weight: 400;
    color: #212529;
    text-align: center;
    vertical-align: middle;
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    background-color: transparent;
    border: 1px solid transparent;
    padding: .375rem .75rem;
    font-size: 1.47rem;
    line-height: 1.5;
    border-radius: .25rem;
    transition: color .15s ease-in-out,background-color .15s ease-in-out,border-color .15s ease-in-out,box-shadow .15s ease-in-out;
    background-image: none;
    box-shadow: none;
}

.btn:focus {
    outline: none;
    outline-offset: 0px;
}

.btn-sm, .alert_next_alliance {
    max-height: 31.5px;
}

.btn-primary {
    color: #fff;
    background-color: #007bff;
    border-color: #007bff;
}

.btn-primary:hover {
    color: #fff;
    background-color: #0069d9;
    border-color: #0062cc;
}

.btn-secondary {
    color: #fff;
    background-color: #6c757d;
    border-color: #6c757d;
}

.btn-secondary:hover {
    color: #fff;
    background-color: #5a6268;
    border-color: #545b62;
}

.btn-default {
    color: #fff;
    background-color: #495159;
    border-color: #434a51;
}

.btn-default:hover {
    color: #fff;
    background-color: #252525;
    border-color: #2a2a2a;
}

.btn-success {
    color: #fff;
    background-color: #28a745;
    border-color: #28a745;
}

.btn-success:hover {
    color: #fff;
    background-color: #218838;
    border-color: #1e7e34;
}

.btn-danger {
    color: #fff;
    background-color: #dc3545;
    border-color: #dc3545;
}

.btn-danger:hover {
    color: #fff;
    background-color: #c82333;
    border-color: #bd2130;
}

.btn-warning {
    color: #212529;
    background-color: #ffc107;
    border-color: #ffc107;
}

.btn-warning:hover {
    color: #212529;
    background-color: #e0a800;
    border-color: #d39e00;
}

.btn-info {
    color: #fff;
    background-color: #17a2b8;
    border-color: #17a2b8;
}

.btn-info:hover {
    color: #fff;
    background-color: #138496;
    border-color: #117a8b;
}

.btn-light {
    color: #212529;
    background-color: #f8f9fa;
    border-color: #f8f9fa;
}

.btn-light:hover {
    color: #212529;
    background-color: #e2e6ea;
    border-color: #dae0e5;
}

.btn-dark {
    color: #fff;
    background-color: #343a40;
    border-color: #343a40;
}

.btn-dark:hover {
    color: #fff;
    background-color: #23272b;
    border-color: #1d2124;
}

.btn-link {
    font-weight: 400;
    color: #007bff;
    text-decoration: none;
}

.btn-link:hover {
    color: #0056b3;
    text-decoration: underline;
}

.btn-group-sm>.btn, .btn-xs {
    padding: .2rem .3rem;
    font-size: 1.3rem;
    line-height: 1.5;
    border-radius: .2rem;
}

/* Panel > Card */
.panel {
    position: relative;
    display: -ms-flexbox;
    display: flex;
    -ms-flex-direction: column;
    flex-direction: column;
    min-width: 0;
    word-wrap: break-word;
    background-color: #333;
    background-clip: border-box;
    border: 1px solid #555;
    border-radius: .25rem;
    border-top-right-radius: 4px;
    box-shadow: 0 3px 6px rgba(0,0,0,0.16), 0 3px 6px rgba(0,0,0,0.23);
}

.panel-heading {
    padding: .75rem 1.25rem;
    margin-bottom: 0;
    background-color: #444;
    border-bottom: 1px solid #555;
    background-image: none !important;
    border-top-left-radius: 0;
}


/* Pushed to bottom because too big */
.logoSmall {
    display: none !important;
}

.navbar-brand[href="/"] {
    padding: 0;
}

.navbar-brand[href="/"]::after {
    visibility: visible;
    margin-top: 2px;
    display: inline-block;
    content: "";
    height: 48px;
    width: 48px;
    background-size: 48px 48px;
    background-image: url("data:image/png;base64,");
}
}

@-moz-document url-prefix("https://www.leitstellenspiel.de/einsaetze"), url-prefix("https://www.meldkamerspel.com/einsaetze"), url-prefix("https://www.missionchief.com/einsaetze") {
.table-striped>tbody>tr.success:nth-of-type(odd) {
    background-color: #d4edda;
    color: #155724;
}

.table-striped>tbody>tr.success:nth-of-type(even) {
    background-color: #c1dbc7;
    color: #155724;
}

.table>tbody>tr.success>td, .table>tbody>tr.success>th, .table>tbody>tr>td.success, .table>tbody>tr>th.success, .table>tfoot>tr.success>td, .table>tfoot>tr.success>th, .table>tfoot>tr>td.success, .table>tfoot>tr>th.success, .table>thead>tr.success>td, .table>thead>tr.success>th, .table>thead>tr>td.success, .table>thead>tr>th.success {
    background-color: transparent;
}

.mission_type_index_searchable.success a {
    color: #2929d7;
}

.btn-default {
    color: #fff !important;
    background-color: #6c757d;
    border-color: #6c757d;
}
}
